description:
Autumnwatch 2014

Nature Documentary hosted by Chris Packham and Michaela Strachan and Martin Hughes Games, published by BBC in 2014 - English narration


Information
------------------------------

Autumnwatch is back with the best of the season's wild stories, live from the beautiful Lancashire coast. Chris Packham, Michaela Strachan and Martin Hughes-Games watch the action unfold as barn owls, starlings and otters prepare for winter.
Part 1.
There is a special report on the most dramatic of autumn spectacles, the red deer rut, as huge male stags fight for the right to mate.
Part 2.
In a special report, Martin heads north to the Baltic Sea on the trail of migrating swans.
Part 3.
Martin immerses himself in the watery world of otters and ducks at RSPB Leighton Moss, and there is a special report from Iolo Williams as he heads to the Welsh coast to rescue fledgling seabirds.
Part 4.
It is Halloween, so this edition is all about the creatures of the night, and there is a special investigation into the latest animal to move into our towns and cities, the urban badger.

